import React from 'react';
import TigranTumoImg from '../../assets/images/TigranTumo.jpg';
import s from './Home.module.css';

function Home(props) {
    let postsElements =
    props.posts.map(p => <Post message={p.message} likesCount={p.likesCount} />);

    return (
        <div className={s.body}>

            {/* right float's image */}
            <img id={s.TigranTumoImg} src='https://www.fs.fed.us/ne/durham/4505/photo_gallery/kenneth_dudzik/19_Bartlett%20Experimental%20Forest_06_Fall%20leaves.jpg' alt="TigranTumoImg" />

            <div className={s.left_block}>
                {/* header about me */}
                <span id={s.header}>Hi all, I'm TigranMets 👋</span>

                {/*text about me*/}
                <span id={s.text_about_me}>Lorem ipsum dolor sit, amet consectetur 🚀 adipisicing elit. Vitae
                    blanditiis eaque reiciendis, corrupti quos fuga, harum consectetur non
                    remsed exercitationem provident doloremque aliquam deserunt!</span>

                {/* Images of social network */}
                <div className={s.socImages}>
                    <a href="https://github.com/TigranMets"><img src="https://upload.wikimedia.org/wikipedia/commons/thumb/9/91/Octicons-mark-github.svg/1200px-Octicons-mark-github.svg.png" alt="github" /></a>
                    <div className={s.socImages_without_github}>
                        <a href="https://www.instagram.com/tigrankheranyan/"><img src={props.socImages.instagram} alt="instagram" /></a>
                        <a href="#"><img src="https://web.telegram.org/img/logo_share.png" alt="telegram" /></a>
                        <a href="#"><img src="https://upload.wikimedia.org/wikipedia/commons/0/05/Facebook_Logo_%282019%29.png" alt="facebook" /></a>
                        <a href="https://www.youtube.com/channel/UCFsM6noHX41yPflmejXwf6A"><img src="https://www.vectorico.com/wp-content/uploads/2018/02/youtube-icon.png" alt="youtube" /></a>
                    </div>
                </div>
                <div className={s.buttons}>
                    {/* button contact me */}
                    <button>Կապնվել ինձ հետ</button>

                    {/* button see my resume */}
                    <button id={s.resume}>Տեսնել իմ Ռեզյումեն</button>
                </div>
            </div>
        </div>
    );
}

export default Home;
